import React from "react";
import Link from "next/link";

class IndexPage extends Component {
  render() {
    return (
      <div>
        <h1>The main Page</h1>
        <p>
          Go to{" "}
          <Link href="/auth">
            <a> Auth</a>
          </Link>
        </p>
      </div>
    );
  }
}

export default IndexPage;
